import React from "react";
import User from "./User";

class Users extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      users: [
        {
          id: 1,
          firstname: "John",
          lastname: "Smith",
          bio: "John Smith",
          age: 40,
          isHappy: true,
        },
        {
          id: 2,
          firstname: "George",
          lastname: "House",
          bio: "George House",
          age: 22,
          isHappy: false,
        },
        {
          id: 3,
          firstname: "Peter",
          lastname: "London",
          bio: "Peter Library",
          age: 33,
          isHappy: true,
        },
      ],
    };
  }

  render() {
    if (this.state.users.length > 0) {
      return (
        <div>
          {this.state.users.map((el) => (
            <User key={el.id} user={el} />
          ))}
        </div>
      );
    } else {
      return (
        <div className="user">
          <h3>Users empty</h3>
        </div>
      );
    }
  }
}

export default Users;
